    cout << "Ð¡ÑÑÐ¾ÐºÐ° Ð´Ð»Ñ ÐºÐ¾Ð´Ð¸ÑÐ¾Ð²Ð°Ð½Ð¸Ñ: " << str_for_encoding << endl;    

    static string slogan = "CRYPTO"s;
    cout << "ÐÐ»ÑÑ\\ÑÐ»Ð¾Ð³Ð°Ð½ " << slogan << endl;

    const string ENCodedStrR(ReplacementCipherENcode(slogan, alphabet, 
        str_for_encoding));
    cout << "ÐÐ°ÑÐ¸ÑÑÐ¾Ð²Ð°Ð½Ð½Ð°Ñ ÑÑÑÐ¾ÐºÐ°: " << ENCodedStrR << endl;
    cout << "ÐÐµÑÐ¸ÑÑÐ¾Ð²Ð°Ð½Ð½Ð°Ñ ÑÑÑÐ¾ÐºÐ°: " << ReplacementCipherDEcode(slogan, alphabet, 
